  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:57.761468\",\n\t\"name\": \"badgers-on-the-rocky-mountain-arsenal\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nineteen badgers (Taxidea taxus) were captured
  on the Rocky Mountain Arsenal (RMA) using Woodstream Softcatch traps and live snares.
  This represents a minimum density estimate of 0.27 badgers per km2. Radio transmitters
  were placed in the abdomens of 10 badgers and a lower premolar was extracted for
  cementum annuli analysis for age determination. Adult badgers (n = 12) averaged
  2.3 years old. Six badgers were radio~located from October 1990 through March 1991,
  but sample sizes were inadequate to generate home range estimates.\",\n\t\"license_title\":
